import React, { useEffect, useState } from 'react';
export default function Movies() {
    const [Movies, fetchMovies] = useState([])
    useEffect(() => {
        fetch('http://localhost:3001/movies')
        .then((res) => res.json())
        .then((res) => {
            fetchMovies(res)
            console.log(res);
        })
    }, []);
    return (
        <>
        {Movies.map((item) => ( 
        <div>
                <img src={item.Poster_Link}></img>
                <h5>{item.Series_Title}</h5>
                <h6>{item.Genre}</h6>
                <h6>{item.Runtime}</h6>
            </div>
        ))}
        </>
    );
}
